import React from 'react';

export function Header () {
    return (
        <div class="header">
            <a id="nav-icon" href=".header">Decoco</a>
        </div>
    );
}

export function Footer () {
    return (
        <div class="footer">
            <p>facebook</p>
            <p>instagram</p>
            <p>pininterest</p>
            <p>google+</p>
        </div>
    );
}
